CREATE TABLE IF NOT EXISTS `market_prices` (
  `id` int NOT NULL AUTO_INCREMENT,
  `product_name` varchar(100) NOT NULL,
  `market` varchar(50) NOT NULL,
  `date` date NOT NULL,
  `price_qirsh_per_kg` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_product_market_date` (`product_name`,`market`,`date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- Add delivery fee columns
ALTER TABLE `orders`
  ADD COLUMN `delivery_fee` decimal(10,2) DEFAULT NULL AFTER `total_price`;

ALTER TABLE `transport_requests`
  ADD COLUMN `delivery_fee` decimal(10,2) DEFAULT NULL AFTER `notes`,
  ADD COLUMN `km_total` decimal(10,2) DEFAULT NULL AFTER `delivery_fee`;


